import React, { useEffect, useState } from 'react';

const StructuresTable = ({ components }) => {

    useEffect(() => {
        console.log('components ', components);
    }, [components])

    return (
        <div>
            <table className="custom-table">
                <thead>
                    <tr>
                        <th>Sequence</th>
                        <th>Item</th>
                        <th>Material Quantity</th>
                        <th>OUM</th>
                    </tr>
                </thead>
                <tbody>
                    {components.map((row) => (
                        <tr key={row.sequence}>
                            <td>{row.sequence}</td>
                            <td>{row.oum}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}

export default StructuresTable
